            <Header>乔碧萝在B站复出立刻遭封杀，理由是身份认证与实际主播不符</Header>
            <Content>
                <div className="pic-div">
                    <img src="https://images.unsplash.com/photo-1489595812352-d3db436c102b?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=400&q=60" alt=''></img>
                </div>
            </Content>
        </DetailWrapper>;
    }
}
